import React from "react";
import "./style.css";
// eslint-disable-next-line no-unused-vars
import NavMessage from "./navMessage";

function Nav(props) {
    return (
        <nav> 
            <ul>
                <li><a href = "/">Clicky Game</a></li>
                <li>Score: {props.score.NavMessage}</li>
                <li>Top Score:{props.topScore.NavMessage}</li>
            </ul>
        </nav>
    )
}

export default Nav;
